    height: 100vh;
    width: 15vw;
    position: fixed;
    z-index: 5;

    display: flex;
    justify-content: center;

    background-color: #111;

`;

const SbTitle = styled.h1`
    width: 100%;
    text-align: center;
    font-size: 32px;
`;

const SbLinks = styled.div`

`;

export default AdminSidebar;
